import { React } from "react";
import { Link } from "react-router-dom";
import "./Style.css"

const Header =() => {

  return (
    <header>
        <ul>  
          <li>

            <p className="StyleHeaderTitle">Lab Notes</p>
          </li>

          <li className="styleLinkBack">
            <Link className="active" to="/pedidos">PEDIDOS LISTOS</Link>
          </li>
        </ul>
    </header>
  );
}
export default Header;
